今日は、珍しく連れ朝ラン。
会社のランニングを始めた男子（ひとまわり下笑）に請われ、一緒に走ることになりました。

ランを始めたはいいが、膝は痛いわ練習の仕方はわからないわだそうで…
いや、アドバイス求める相手間違えてるよ。
私は永遠の初級者よ笑

雨上がりの６時スタートは、意外と人少な。
ランナーの聖地・総合グラウンドを走った事がない！そうなので、まずはグラウンドからご案内。
そこから旭川の土手経由、岡山城を眺める名所巡りラン。
ほぼ観光😅

膝の痛い彼の調子を見つつ、初めてのLSDにお付き合いとなりました。
 LSDなら任せろ！得意中の得意だ！笑

乏しいラン経験談やよしなしことを話しながら、のんびり走りました。
楽しかったし勉強になりましたと言ってくれて、コースやなんやら考えた甲斐があって良かったです😅
またいきましょう♫
